function setsize(value) {
  if (!localStorage.size) {
    localStorage.setItem('Fieldsize', 120);
  } else if (value === 0) {
    localStorage.setItem('Fieldsize', 120);
  } else if (value === 1) {
    localStorage.setItem('Fieldsize', 180);
  } else if (value === 2) {
    localStorage.setItem('Fieldsize', 240);
  }
}

export default setsize;
